(function(){
  function load(src){
    var s = document.createElement('script');
    s.src = src;
    s.crossOrigin = 'anonymous';
    document.head.appendChild(s);
  }
  if (!(window.$ && window.$.fn && window.$.AdminLTE)){
    load('https://cdnjs.cloudflare.com/ajax/libs/admin-lte/2.4.18/js/adminlte.min.js');
  }
})();
